import React from "react";

class Title extends React.Component{

    constructor(props){
        super(props);

        this.number=0;
    }

    counter(){
        this.number++;
        console.log(this.number);
    }

    render() {
        return(
            <div>
                <p>{this.number}</p>
                <button onClick={()=>this.counter()}>Click me!</button>
            </div>
        )
    }
}

export default Title;
